using Core;using Memory.Logic;using UnityEngine;namespace Memory.MonoBehaviours{    public class GameBootstrap : MonoBehaviour    {        public void Awake()        {            Game.Awake(factory: FindObjectOfType<Factory>(), grid: FindObjectOfType<Grid>());        }        public void Start()        {            Game.Start();        }        public void Update()        {            Game.Update();        }    }}